import React, { useState } from "react";
import { useParams, useNavigate } from "react-router-dom";
import "./CarDetailPage.css";

const CarDetailPage = ({ cars }) => {
  const { id } = useParams();
  const navigate = useNavigate();
  const car = cars.find(c => c.id === parseInt(id));
  const [currentIndex, setCurrentIndex] = useState(0);

  if (!car) return <div>Автомобиль не найден</div>;

  const currentImage = car.images[currentIndex];

  const nextSlide = () => setCurrentIndex((currentIndex + 1) % car.images.length);
  const prevSlide = () => setCurrentIndex((currentIndex - 1 + car.images.length) % car.images.length);
  const selectSlide = (index) => setCurrentIndex(index);

  return (
    <div className="car-detail-page">
      <button onClick={() => navigate(-1)} className="back-button">← Назад</button>
      <div className="car-content">
        <div className="car-details">
          <h3>{car.brand} {car.model}</h3>
          <ul>
            <li><b>Год:</b> {car.details.year}</li>
            <li><b>Пробег:</b> {car.details.mileage} км</li>
            <li><b>Кузов:</b> {car.details.body}</li>
            <li><b>Цвет:</b> {car.details.color}</li>
            <li><b>Двигатель:</b> {car.details.engine}</li>
            <li><b>Коробка:</b> {car.details.gearbox}</li>
            <li><b>Привод:</b> {car.details.drive}</li>
            <li><b>Руль:</b> {car.details.wheel}</li>
            <li><b>Состояние:</b> {car.details.condition}</li>
            <li><b>Таможня:</b> {car.details.customs}</li>
            <li><b>Обмен:</b> {car.details.exchange}</li>
            <li><b>Наличие:</b> {car.details.availability}</li>
            <li><b>Город:</b> {car.details.location}</li>
          </ul>
        </div>

        <div className="car-gallery">
          <div className="main-image">
            <button className="arrow left" onClick={prevSlide}>‹</button>
            <img
              src={currentImage.url}
              alt={currentImage.caption}
              width="553"
              height="415"
              style={{ objectFit: "cover" }}
            />
            <button className="arrow right" onClick={nextSlide}>›</button>
          </div>

          <div className="thumbnails">
            {car.images.map((img, i) => (
              <img
                key={i}
                src={img.url}
                onClick={() => selectSlide(i)}
                className={i === currentIndex ? "active-thumb" : ""}
                alt={`thumb-${i}`}
                width="100"
                height="75"
              />
            ))}
          </div>

          <div className="indicator">
            {car.images.map((_, i) => (
              <span key={i} className={i === currentIndex ? "dot active" : "dot"} />
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default CarDetailPage;
